import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
        <h1 className="title">Soft Green Theme UI</h1>
        <button className="button">Click me!</button>
      </div>
    </div>
  );
}

export default App;
